INSERT INTO `sprints` VALUES ('018a1ba5-dda1-4179-b73e-176e6693a371','1000005',_binary '\0',NULL,'2025-07-04 08:56:22.665524',NULL,'2025-07-04 08:56:22.665524','1000005','2025-03-14 17:00:00.000000','2025-03-04 17:00:00.000000','2025-03-01 17:00:00.000000',15,'Hiện thực chức năng sản phẩm','3d4c23db-a9f0-41d2-aa6e-5254b7f48277','<p>- Xác định các thuộc tính của sản phẩm</p><p>- 1 sản phẩm phải có 1 hoăc nhiều ảnh</p><p>- Được phép tìm kiếm sản phẩm theo nhiều tiêu chí</p><p>- Hiện thực trang danh sách sản phẩm và sản phẩm chi tiết</p>'),('06a57b77-0290-450f-8312-db22e8c21c78','1000004',_binary '\0',NULL,'2025-07-04 08:45:18.463724',NULL,'2025-07-04 08:45:18.463724','1000004','2025-05-02 17:00:00.000000','2025-04-22 17:00:00.000000','2025-04-19 17:00:00.000000',15,'Tối ưu các mẫu đã hiện thực','7271fe01-d53f-498f-9d87-2042d6f524ab','<p>- Tối ưu các mẫu đã áp dụng vào chức năng</p>'),('0a98d5b3-7a3f-4cd0-a294-b04adeccbe7c','1000005',_binary '\0',NULL,'2025-07-04 08:57:10.907838',NULL,'2025-07-04 08:57:10.907838','1000005','2025-03-21 17:00:00.000000','2025-03-16 17:00:00.000000','2025-03-15 17:00:00.000000',12,'Hiện thực chức năng giỏ hàng','3d4c23db-a9f0-41d2-aa6e-5254b7f48277','<p>- Xác định các thuộc tính của giỏ hàng</p><p>- Lưu giỏ hàng trong session</p><p>- Hiện thực chức năng thêm, xóa sản phẩm trong giỏ hàng, tăng giảm số lượng trong giỏ hàng</p>'),('0e1c0884-cd4f-4efe-85cf-ed3d6c1fce8d','1000005',_binary '\0',NULL,'2025-07-04 08:58:57.763223',NULL,'2025-07-04 08:58:57.763223','1000005','2025-03-28 17:00:00.000000','2025-03-23 17:00:00.000000','2025-03-22 17:00:00.000000',10,'Hiện thực chức mã giảm giá','3d4c23db-a9f0-41d2-aa6e-5254b7f48277','<p>- Áp dụng mã giảm giá cho đơn hàng, có giá trị tối thiểu áp dụng</p><p>- Triển khai mã giảm gía cho ngừời dùng</p>'),('20550769-da23-4d54-983e-bdcc62d80a37','1000005',_binary '\0',NULL,'2025-07-04 09:08:11.897445',NULL,'2025-07-04 09:08:11.897445','1000005','2025-05-17 17:00:00.000000','2025-05-06 17:00:00.000000','2025-05-03 17:00:00.000000',20,'Hiện thực các chức năng đặc biệt theo  từng đề tài chuyên biệt','3d4c23db-a9f0-41d2-aa6e-5254b7f48277','<p>- Xây dựng các chức năng đặc biệt dành cho đề tài</p>'),('28e4b229-c075-444e-bb7e-b2f27a9fd103','1000005',_binary '\0',NULL,'2025-07-04 08:59:50.087500',NULL,'2025-07-04 08:59:50.087500','1000005','2025-04-11 17:00:00.000000','2025-04-01 17:00:00.000000','2025-03-29 17:00:00.000000',20,'Hiện thực chức năng đơn hàng','3d4c23db-a9f0-41d2-aa6e-5254b7f48277','<p>- Lựa chọn phương thức thanh toán</p><p>- Xác định các trạng thái cần thiết cho đơn hàng, quá trình chuyển đổi trạng thái của đơn hàng từ </p><p>lúc bắt đầu đến khi thành công</p><p>- Hiện thực cách tính tiền cho sản phẩm</p><p>- Lưu thông tin người mua: họ tên, địa chỉ, số điện thoại</p><p>- Người dùng có thể xem các đơn hàng đã đặt của người dùng</p><p>- Quản lý cập nhập trạng thái đơn hàng cho quản lý</p><p>- Thông báo khi đặt hàng thành công</p>'),('2fec7291-d7dd-4835-853f-f3d8453487eb','1000001',_binary '\0',NULL,'2025-07-04 06:25:14.495539',NULL,'2025-07-04 06:25:14.495539','1000001','2025-04-18 17:00:00.000000','2025-04-07 17:00:00.000000','2025-04-04 17:00:00.000000',15,'Hiệu chỉnh và báo cáo','88e830a7-f240-4d0f-b8f3-bd08cfb69607','<p>- Hiệu chỉnh mô hình nếu có thể, thực hiện lại các yêu cầu ở sprint 3 và sprint 4</p><p>- Upload src code </p><p>- Chuẩn bị tài liệu báo cáo</p>'),('36524122-5b4b-47aa-8d46-d064c6cb28fd','1000003',_binary '\0',NULL,'2025-07-04 08:21:57.237432',NULL,'2025-07-04 08:21:57.237432','1000003','2025-02-28 17:00:00.000000','2025-02-18 17:00:00.000000','2025-02-15 17:00:00.000000',10,'Kiến thức Android cơ bản','139b821a-f5d0-49c8-9f26-da68e54d59a2','<p>- Học các kiến thức về Page, Fragment, Navigate, Animation</p><p>- Xây dựng thành phần giao diện bằng XML</p><p>- Xây dựng prototype cho các giao diện cơ bản</p><p>- Phân tích, tổ chức mã nguồn cho dự án</p>'),('4af885f3-a68c-4204-8840-2a1c179222a4','1000004',_binary '\0',NULL,'2025-07-04 08:34:14.632668',NULL,'2025-07-04 08:34:14.632668','1000004','2025-02-28 17:00:00.000000','2025-02-18 17:00:00.000000','2025-02-15 17:00:00.000000',15,'Tìm hiểu các tính chât của OOP','7271fe01-d53f-498f-9d87-2042d6f524ab','<p>- Tìm hiểu 4 tính chất OOP</p><p>- Học nguyên tắc vẽ Use Case Diagram</p><p>- Học nguyên tắc vẽ Class Diagram</p><p>- Học về khái niệm và ứng dụng của Class, Abstract, Interface, Instance</p><p>- Hiện thực các chức năng đã đề ra bằng phương pháp OOP</p>'),('4bccc8ff-e9e3-43ec-b037-a2df9987185e','1000004',_binary '\0',NULL,'2025-07-04 08:33:06.700710',NULL,'2025-07-04 08:33:06.700710','1000004','2025-02-14 17:00:00.000000','2025-02-09 17:00:00.000000','2025-02-08 17:00:00.000000',10,'Chọn đề tài và ngôn ngữ thực hiện','7271fe01-d53f-498f-9d87-2042d6f524ab','<p>- Lựa chọn đề tài </p><p>- Lựa chọn ngôn ngữ thực hiện</p><p>- Chọn các chức năng thực hiện phù hợp với đề tài và yêu cầu giảng viên</p>'),('4c814469-68fa-494a-9e93-90ccff9d6eaa','1000002',_binary '\0',NULL,'2025-07-04 08:13:41.590556',NULL,'2025-07-04 08:13:41.590556','1000002','2025-05-09 17:00:00.000000','2025-05-04 17:00:00.000000','2025-05-03 17:00:00.000000',10,'Kiểm thử và báo cáo','792e6f85-582a-4f65-a50d-e7c59cefb7b2','<p>- Kiểm thử toàn bộ ứng dụng</p><p>- Chuẩn bị usecase diagram</p><p>- Chuẩn bị ERD</p><p>- Chuẩn bị ứng dụng</p>'),('50b47ab0-c2b8-4bfd-95bf-c35023aaf198','1000001',_binary '\0',NULL,'2025-07-04 06:15:42.316107',NULL,'2025-07-04 06:23:07.244545','1000001','2025-03-19 17:00:00.000000','2025-03-08 17:00:00.000000','2025-03-05 17:00:00.000000',20,'Lựa chọn mô hình và huấn luyện','88e830a7-f240-4d0f-b8f3-bd08cfb69607','<p>- Lựa chọn mô hình (1 hoặc nhiều), ghi nhận điểm mạnh và yếu của tứng mô hình</p><p>- Lựa chọn tham số cho mô hình</p><p>- Tiến hành huấn luyện mô hình dựa trên dataset đã tiền xử lý, ghi nhận các kết quả thu được tại mỗi mô hình</p><p>- Lập các sơ đồ thống kê kết quả như confusion matrix, từ đó chọn ra mô hình thu nhận được kết quả tốt nhất</p>'),('565e13cb-7a4c-4f75-88f2-903a54ddc690','1000005',_binary '\0',NULL,'2025-07-04 08:52:37.772033',NULL,'2025-07-04 08:52:37.772033','1000005','2025-02-14 17:00:00.000000','2025-02-09 17:00:00.000000','2025-02-08 17:00:00.000000',20,'Tìm hiểu bải toán','3d4c23db-a9f0-41d2-aa6e-5254b7f48277','<p>- Chọn đề tài</p><p>- Ghi nhận các yêu cầu chung của giảng viên</p><p>- Ghi nhận các kiến thức và điểm mạnh của các thành viên</p><p>- Thiết lập khu vực lưu trữ code cho nhóm trên Github</p>'),('5d57fb7a-7aab-4264-a6cf-12fc55f5093d','1000005',_binary '\0',NULL,'2025-07-04 08:55:31.632635',NULL,'2025-07-04 08:55:31.632635','1000005','2025-02-28 17:00:00.000000','2025-02-23 17:00:00.000000','2025-02-22 17:00:00.000000',10,'Hiện thực chức năng đăng nhập,  đăng ký người dùng và phân quyền','3d4c23db-a9f0-41d2-aa6e-5254b7f48277','<p>- Ứng dụng session vào chức năng đăng nhập</p><p>- Hiện thực chức năng đăng ký</p><p>- Xác thực người dùng đã đăng ký</p><p>- Mã hóa mật khẩu</p><p>- Chặn người dùng vào môt số trang theo quyền hạn </p><p>- Phân quyền cho khách hàng và quản lý</p>'),('697b373f-2d73-48e9-90d4-ab516cc7d2aa','1000002',_binary '\0',NULL,'2025-07-04 08:08:17.994815',NULL,'2025-07-04 08:08:17.994815','1000002','2025-04-25 17:00:00.000000','2025-04-15 17:00:00.000000','2025-04-12 17:00:00.000000',15,'Các chức năng đặc biệt','792e6f85-582a-4f65-a50d-e7c59cefb7b2','<p>- Hiện thực các chức năng đặc biệt mà đã đề ra ở usecase</p>'),('6a01e474-92f2-440e-9cc1-c1041de2e1be','1000004',_binary '\0',NULL,'2025-07-04 08:42:22.778899',NULL,'2025-07-04 08:42:22.778899','1000004','2025-03-28 17:00:00.000000','2025-03-23 17:00:00.000000','2025-03-22 17:00:00.000000',8,'Học và ứng dụng Decorator và Iterator pattern','7271fe01-d53f-498f-9d87-2042d6f524ab','<p>- Chọn chức năng phù hợp với mẫu và hiện thực</p><p>- Ghi tài liệu</p>'),('8b238fa2-6e02-47b0-8343-bd97d791ae65','1000003',_binary '\0',NULL,'2025-07-04 08:28:35.394747',NULL,'2025-07-04 08:28:35.394747','1000003','2025-04-25 17:00:00.000000','2025-04-20 17:00:00.000000','2025-04-19 17:00:00.000000',10,'Chuẩn bị và báo cáo','139b821a-f5d0-49c8-9f26-da68e54d59a2','<p>- Cung cấp tài liệu (hệ thống, giới thiệu đề tài, hướng dẫn sử dụng)</p><p>- Ứng dụng đã hiện thực</p>'),('8e395f10-31a4-4e06-b450-52d7c50da7e0','1000004',_binary '\0',NULL,'2025-07-04 08:37:12.650674',NULL,'2025-07-04 08:37:21.475669','1000004','2025-03-14 17:00:00.000000','2025-03-10 17:00:00.000000','2025-03-08 17:00:00.000000',10,'Học và ứng dụng Singleton và Observer pattern','7271fe01-d53f-498f-9d87-2042d6f524ab','<p>- Chọn chức năng phù hợp với mẫu và hiện thực</p><p>- Ghi tài liệu</p>'),('94b4cde8-df2d-4241-a80a-d79fffaafd45','1000001',_binary '\0',NULL,'2025-07-04 06:13:18.718821',NULL,'2025-07-04 06:22:52.866304','1000001','2025-03-04 17:00:00.000000','2025-02-21 17:00:00.000000','2025-02-18 17:00:00.000000',20,'Xử lý Dataset','88e830a7-f240-4d0f-b8f3-bd08cfb69607','<p>- Thống kê đối với mỗi tập dataset tìm được</p><p>- Tiền xử lý dữ liệu cho từng tập dataset bằng các phương pháp, thực hiện thống kê  sau khi tiền xử lý</p><p>- Ghi nhận các kết quả vào tài liệu</p>'),('99157455-4dac-4bd4-a540-f43c0fd93145','1000004',_binary '\0',NULL,'2025-07-04 08:43:46.246538',NULL,'2025-07-04 08:43:46.246538','1000004','2025-04-04 17:00:00.000000','2025-03-30 17:00:00.000000','2025-03-29 17:00:00.000000',8,'Học và ứng dụng Template Method và Visitor pattern','7271fe01-d53f-498f-9d87-2042d6f524ab','<p>- Chọn chức năng phù hợp với mẫu và hiện thực</p><p>- Ghi tài liệu</p>'),('99d36620-1576-4e19-99fb-c132541b860f','1000002',_binary '\0',NULL,'2025-07-04 07:47:41.511143',NULL,'2025-07-04 07:47:41.511143','1000002','2025-03-07 17:00:00.000000','2025-02-26 17:00:00.000000','2025-02-23 17:00:00.000000',20,'Thiết kế','792e6f85-582a-4f65-a50d-e7c59cefb7b2','<p>- Vẽ usecase diagram</p><p>- Vẽ kiến trúc hạ tầng, nền tảng thực hiện</p><p>- Các công nghệ sử dụng, thiết lập khu vực làm việc cho nhóm</p><p>- Trình bày kế hoạch của dự án thông qua PPT</p>'),('9a767bf6-8caf-43d2-b1d2-2e00b54bd6a7','1000003',_binary '\0',NULL,'2025-07-04 08:27:06.946410',NULL,'2025-07-04 08:27:06.946410','1000003','2025-04-11 17:00:00.000000','2025-04-01 17:00:00.000000','2025-03-29 17:00:00.000000',20,'Hiện thực Admin Module','139b821a-f5d0-49c8-9f26-da68e54d59a2','<p>- Hiện thực các chức năng quản lý cho các thực thể chuyên biệt của đề tài</p><p>VD: nếu bán hàng thì phải có chức năng tạo sản phẩm, ứng dụng nghe nhạc thì phải có chức năng tải nhạc</p>'),('9ebb1a1a-bbf5-4724-9692-fd08a591164b','1000004',_binary '\0',NULL,'2025-07-04 08:47:24.326636',NULL,'2025-07-04 08:47:24.326636','1000004','2025-05-09 17:00:00.000000','2025-05-04 17:00:00.000000','2025-05-03 17:00:00.000000',10,'Kiểm thử và báo cáo','7271fe01-d53f-498f-9d87-2042d6f524ab','<p>- Tổng hợp document, có sơ đồ kiến trúc và ảnh minh họa ứng dụng các mẫu vào chức năng</p>'),('bbfc8df2-5eb2-4a78-84d1-1e65beddd6f3','1000004',_binary '\0',NULL,'2025-07-04 08:44:35.347330',NULL,'2025-07-04 08:44:35.347330','1000004','2025-04-18 17:00:00.000000','2025-04-08 17:00:00.000000','2025-04-05 17:00:00.000000',15,'Học và ứng dụng mô hình MVC trong xây dựng ứng dụng','7271fe01-d53f-498f-9d87-2042d6f524ab','<p>- Chọn chức năng phù hợp với mẫu và hiện thực</p><p>- Ghi tài liệu</p>'),('be992de1-8f5a-4c5b-8158-2d7ae3c7ab38','1000001',_binary '\0',NULL,'2025-07-04 06:24:11.400982',NULL,'2025-07-04 06:24:11.400982','1000001','2025-04-03 17:00:00.000000','2025-03-23 17:00:00.000000','2025-03-20 17:00:00.000000',15,'Ứng dụng','88e830a7-f240-4d0f-b8f3-bd08cfb69607','<p>- Xây dựng giao diện ứng dụng để sử dụng mô hình (nếu có)</p><p>- Áp dụng mô hình vào dữ liệu thực tế, ghi nhận kết quả</p>'),('c469d85a-a19c-4411-88ca-c0041af4f8e5','1000003',_binary '\0',NULL,'2025-07-04 08:20:18.520837',NULL,'2025-07-04 08:20:18.520837','1000003','2025-02-14 17:00:00.000000','2025-02-09 17:00:00.000000','2025-02-08 17:00:00.000000',10,'Tìm hiểu công nghệ sử dụng','139b821a-f5d0-49c8-9f26-da68e54d59a2','<p>- Nền tảng phát triển Android hoặc IOS</p><p>- Lựa chọn đề tài (có phần admin để quản lý nếu là bài toán bán hàng)</p><p>- Phân tích usecase của đề tài, liệt kê các chức năng cần thiết</p><p>- Xây dựng quy tắc làm việc cho nhóm, thiết lập Version control</p>'),('ca990a18-1ecf-4677-b4f5-ff3f9c679fe3','1000002',_binary '\0',NULL,'2025-07-04 08:12:31.161494',NULL,'2025-07-04 08:12:31.161494','1000002','2025-05-02 17:00:00.000000','2025-04-28 17:00:00.000000','2025-04-26 17:00:00.000000',15,'Hiện thực các chức năng bổ sung','792e6f85-582a-4f65-a50d-e7c59cefb7b2','<p>- Hiện thực review sản phẩm</p><p>- Điều chỉnh lại các UI của các phần đã làm</p><p>- Bổ sung các trang giới thiệu còn thiếu</p>'),('d1e3dfdf-dfac-4693-bb79-fa08d8aad9fc','1000002',_binary '\0',NULL,'2025-07-04 07:28:08.003470',NULL,'2025-07-04 07:30:36.341795','1000002','2025-02-15 17:00:00.000000','2025-02-10 17:00:00.000000','2025-02-09 17:00:00.000000',10,'Khái niệm và kiến thức liên quan','792e6f85-582a-4f65-a50d-e7c59cefb7b2','<p>- Business Model : B2C, B2B</p><p>- Keyword Business</p><p>- Business Plan</p><p>- Các kiến thức liên quan đến doanh thu, vốn.</p><p>- Các yêu cầu kỹ thuật cần thiết cho thương mại điện tử</p>'),('d7111352-035f-46fa-9d96-85812f81b0f4','1000003',_binary '\0',NULL,'2025-07-04 08:26:19.061390',NULL,'2025-07-04 08:26:19.061390','1000003','2025-03-28 17:00:00.000000','2025-03-18 17:00:00.000000','2025-03-15 17:00:00.000000',20,'Hiện thực Business Module','139b821a-f5d0-49c8-9f26-da68e54d59a2','<p>- Hiện thực các chức năng chuyên biệt theo đề tài đã chọn</p>'),('dd34ecaf-9783-4b03-b211-edc72a3e5f31','1000004',_binary '\0',NULL,'2025-07-04 08:39:43.705417',NULL,'2025-07-04 08:39:43.705417','1000004','2025-03-21 17:00:00.000000','2025-03-16 17:00:00.000000','2025-03-15 17:00:00.000000',10,'Học và ứng dụng Factory Method và Abstract Factory pattern','7271fe01-d53f-498f-9d87-2042d6f524ab','<p>- Chọn chức năng phù hợp với mẫu và hiện thực</p><p>- Ghi tài liệu</p>'),('de1a9928-7d90-4b22-9f2c-1c1977a9b1d3','1000005',_binary '\0',NULL,'2025-07-04 08:54:40.635421',NULL,'2025-07-04 08:54:40.635421','1000005','2025-02-21 17:00:00.000000','2025-02-16 17:00:00.000000','2025-02-15 17:00:00.000000',12,'Phân tích yêu cầu và chuẩn bị kiến thức','3d4c23db-a9f0-41d2-aa6e-5254b7f48277','<p>- Phân tích yêu cầu và chuẩn bị kiến thức</p><p>- Xây dựng ERD</p>'),('dea18fd8-488a-4ba4-ab67-465749cc8498','1000003',_binary '\0',NULL,'2025-07-04 08:23:12.561275',NULL,'2025-07-04 08:23:12.561275','1000003','2025-03-07 17:00:00.000000','2025-03-02 17:00:00.000000','2025-03-01 17:00:00.000000',10,'Hiện thực Auth module','139b821a-f5d0-49c8-9f26-da68e54d59a2','<p>- Chọn cách thức xác thực người dùng (session hoặc token)</p><p>- Hiện thực chức năng đăng nhập</p><p>- Hiện thực chức năng đăng ký và xác thực người dùng</p><p>- Bảo vệ các trang mà người dùng không được truy cập</p>'),('e3fcd8e9-d658-4bbe-bb8f-6bf08a593ad3','1000003',_binary '\0',NULL,'2025-07-04 08:24:11.881899',NULL,'2025-07-04 08:24:11.881899','1000003','2025-03-14 17:00:00.000000','2025-03-09 17:00:00.000000','2025-03-08 17:00:00.000000',10,'Hiện thực User Module','139b821a-f5d0-49c8-9f26-da68e54d59a2','<p>- Hiện thực cập nhập thông tin người dùng</p><p>- Hiện thực chức năng đổi mật khẩu</p>'),('eb648995-761c-42b7-9a55-2e2a8d67acae','1000002',_binary '\0',NULL,'2025-07-04 07:49:56.718423',NULL,'2025-07-04 07:49:56.718423','1000002','2025-03-14 17:00:00.000000','2025-03-10 17:00:00.000000','2025-03-08 17:00:00.000000',10,'Hiện thực chức người dùng','792e6f85-582a-4f65-a50d-e7c59cefb7b2','<p>- Đăng nhập, đăng ký, phâ quyền (tối thiểu 3 vai trò)</p><p>- Thay đổi thông tin cá nhân, avatar</p><p>- Thay đổi mật khẩu, quên mật khẩu</p><p>- Quản lý người dùng cho admin</p>'),('ed56cfbc-3019-48c5-9109-e97c30d0e4f5','1000001',_binary '\0',NULL,'2025-07-04 05:56:20.074907',NULL,'2025-07-04 06:20:13.514216','1000001','2025-02-16 17:00:00.000000','2025-02-11 17:00:00.000000','2025-02-09 17:00:00.000000',12,'Chọn đề tài và chuẩn bị','88e830a7-f240-4d0f-b8f3-bd08cfb69607','<p>- Chọn đề tài</p><p>- Xây dựng yêu cầu cần đạt đối với đề tài đã chọn</p><p>- Chuẩn bị các kiến thức cần thiết đối với các mô hình sẽ thực hiện</p><p>- Chuẩn bị không gian lưu trữ document và source code (sử dụng google collab)</p><p>- Chọn các dataset có khả năng thực thi đối với đề tài (Quan trọng)</p>'),('f19b6b33-be76-4d2b-b85d-dbd4caf3da1d','1000004',_binary '\0',NULL,'2025-07-04 08:36:13.239436',NULL,'2025-07-04 08:36:26.919322','1000004','2025-03-07 17:00:00.000000','2025-03-02 17:00:00.000000','2025-03-01 17:00:00.000000',8,'Học và ứng dụng Strategy','7271fe01-d53f-498f-9d87-2042d6f524ab','<p>- Chọn chức năng phù hợp với mẫu và hiện thực</p><p>- Ghi tài liệu</p>'),('f47550be-910c-44a4-b293-eab3ee6aca92','1000002',_binary '\0',NULL,'2025-07-04 07:52:30.935276',NULL,'2025-07-04 07:52:30.935276','1000002','2025-03-28 17:00:00.000000','2025-03-18 17:00:00.000000','2025-03-15 17:00:00.000000',20,'Hiện thực chức năng  liên quan đến sản phẩm kinh doanh','792e6f85-582a-4f65-a50d-e7c59cefb7b2','<p>- Hiển thị danh sách sản phẩm, hỗ trợ lọc theo giá, thể loại,... thông qua URL</p><p>- Xem chi tiết sản phẩm, có phần thống kê đánh giá, bình luận</p><p>- Xây dựng một số trang hiển thị sản phẩm đặc biệt như sản phẩm bán chạy, sản phẩm mới</p><p>- Quản lý sản phẩm dành cho admin</p>'),('f4b01b71-8ab6-4291-8fee-135a8f7c0d94','1000003',_binary '\0',NULL,'2025-07-04 08:27:43.280819',NULL,'2025-07-04 08:27:43.280819','1000003','2025-04-18 17:00:00.000000','2025-04-13 17:00:00.000000','2025-04-12 17:00:00.000000',10,'Kiểm thử và đóng gói','139b821a-f5d0-49c8-9f26-da68e54d59a2','<p>- Kiểm thử toàn bộ luồng chạy của ứng dụng</p><p>- Fix các lỗi liên quan đến giao diện và business nếu có</p><p>- Có thể lựa chọn đóng gói ứng dụng </p>'),('f87463f4-3d2c-49f1-9f20-a4510eb0728f','1000002',_binary '\0',NULL,'2025-07-04 07:34:14.409154',NULL,'2025-07-04 07:34:14.409154','1000002','2025-02-22 17:00:00.000000','2025-02-18 17:00:00.000000','2025-02-16 17:00:00.000000',16,'Chuẩn bị bài toán','792e6f85-582a-4f65-a50d-e7c59cefb7b2','<p>- Lựa chọn lĩnh vực kinh doanh</p><p>- Thiết kế slide thuyết trình để trình bày dự án</p><p>- Lựa chọn công nghệ và nền tảng hiện thực</p><p>- Lựa chọn chức năng, vẽ usecase diagram</p>'),('f8bdf08c-c32d-4863-86b2-44a36a756fac','1000002',_binary '\0',NULL,'2025-07-04 07:57:06.189675',NULL,'2025-07-04 07:57:06.189675','1000002','2025-04-11 17:00:00.000000','2025-04-01 17:00:00.000000','2025-03-29 17:00:00.000000',20,'Hiện thực chức năng cho đơn hành  và thanh toán','792e6f85-582a-4f65-a50d-e7c59cefb7b2','<p>- Hiện thực giỏ hàng</p><p>- Tạo đơn hàng, ghi nhận lại các thông tin người nhận và không được thay đổi</p><p>- Lấy địa chỉ tỉnh thành, có thể lựa chọn tính giá vận chuyển</p><p>- Tích hợp thanh toán của ví điện từ phổ biến</p><p>- Trang quản lý đơn hàng cho khách hàng và admin</p><p>- Admin được thay đổi trạng thái đơn hàng với các ràng buộc</p>');
